import React from 'react';

const Day = (props) => ( 
    <div>
        Temperature: {props.temperature}
        Humidity: {props.humidity}
        Oblaci: {props.weatherDescription}
        <img src={props.icon} alt={props.icon}></img>
    </div>
);

export default Day;
